import React, { useState } from 'react';
// import AddUser from './component/UI/User/AddUser';
// import UserList from './component/UI/User/UserList';
import Expenses from './component/Expenses/Expenses';
import NewExpense from "./component/NewExpense/NewExpense"
function App() {
  // const [userList,setUserList] = useState([])
  // function onAddingUser(uName){
  //   console.log("In App.js: ", uName)
  //   return setUserList((prevState)=> [...prevState,{name: uName, id: Math.random().toString()}])
  // }
  const [expenses,setExpenses] = useState([
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ]);
  function getExpenses(enteredExpense){
    setExpenses((prevState)=>{return [...prevState,enteredExpense]})

  }
  // return React.createElement("div",{},React.createElement(Expenses,{expenses:expenses}))
  return (
    <div>
      <NewExpense getExpenses={getExpenses}/>
      <Expenses expenses={expenses}/>
    </div>
  );
}

export default App;
